package com.azry.cdms.model.user;

import com.azry.cdms.model.points.PointFilterState;

import javax.persistence.Column;
import javax.persistence.Entity;
import javax.persistence.GeneratedValue;
import javax.persistence.GenerationType;
import javax.persistence.Id;
import javax.persistence.Lob;
import javax.persistence.ManyToMany;
import javax.persistence.SequenceGenerator;
import javax.persistence.Transient;
import javax.validation.constraints.Size;
import javax.xml.bind.JAXBContext;
import javax.xml.bind.JAXBException;
import javax.xml.bind.Marshaller;
import javax.xml.bind.Unmarshaller;
import javax.xml.bind.annotation.XmlElement;
import javax.xml.bind.annotation.XmlElementWrapper;
import javax.xml.bind.annotation.XmlRootElement;
import java.io.Serializable;
import java.io.StringReader;
import java.io.StringWriter;
import java.util.ArrayList;
import java.util.List;

@XmlRootElement
@Entity(name = "SystemUser")
public class User implements Serializable {

	private static JAXBContext jaxbCtx;

	static {
		try {
			jaxbCtx = JAXBContext.newInstance(PointFilterState.class);
		} catch (JAXBException ex) {
			throw new IllegalStateException(ex);
		}
	}

	private boolean requiredChange;

	private Integer id;

	private String name;

	private List<UserGroup> userGroups = new ArrayList<>();

	private String password;

	private boolean active;

	private boolean sysAdmin;

	private String email;

	private String mobile;

	private String username;

	private String contactInformation;

	private String permittedPointsData;

	private PointFilterState permittedPoints;

	private Long languageId;

	public boolean isRequiredChange() {
		return requiredChange;
	}

	public void setRequiredChange(boolean requiredChange) {
		this.requiredChange = requiredChange;
	}

	@Id
	@GeneratedValue(strategy=GenerationType.SEQUENCE, generator = "USER_KEY_SEQUENCE")
	@SequenceGenerator(name = "USER_KEY_SEQUENCE", sequenceName = "USER_KEY_SEQUENCE")
	public Integer getId() {
		return id;
	}

	public void setId(Integer id) {
		this.id = id;
	}

	@Size(max = 100)
	@Column(length = 100)
	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	@ManyToMany
	@XmlElement(name="user-group")
	@XmlElementWrapper(name="user-groups")
	public List<UserGroup> getUserGroups() {
		return userGroups;
	}

	public void setUserGroups(List<UserGroup> userGroups) {
		this.userGroups = userGroups;
	}

	public void setPassword(String password) {
		this.password = password;
	}

	@Size(max = 50)
	@Column(length = 50)
	public String getPassword() {
		return password;
	}

	public void setActive(boolean active) {
		this.active = active;
	}

	public boolean isActive() {
		return active;
	}

	public boolean isSysAdmin() {
		return sysAdmin;
	}

	public void setSysAdmin(boolean sysAdmin) {
		this.sysAdmin = sysAdmin;
	}

	public void setEmail(String email) {
		this.email = email;
	}

	@Size(max = 50)
	@Column(length = 50)
	public String getEmail() {
		return email;
	}

	public void setMobile(String mobile) {
		this.mobile = mobile;
	}

	@Size(max = 50)
	@Column(length = 50)
	public String getMobile() {
		return mobile;
	}

	public void setUsername(String username) {
		this.username = username;
	}

	@Size(max = 50)
	@Column(length = 50)
	public String getUsername() {
		return username;
	}

	@Size(max = 200)
	@Column(length = 200)
	public String getContactInformation() {
		return contactInformation;
	}

	public void setContactInformation(String contactInformation) {
		this.contactInformation = contactInformation;
	}

	@Transient
	public PointFilterState getPermittedPoints() {
		if (permittedPoints == null) {
			if (permittedPointsData == null) {
				return null;
			}
			try {
				Unmarshaller unmarshaller = jaxbCtx.createUnmarshaller();
				StringReader reader = new StringReader(permittedPointsData);
				permittedPoints = (PointFilterState) unmarshaller.unmarshal(reader);
			} catch (JAXBException e) {
				e.printStackTrace();
			}
		}
		return permittedPoints;
	}

	public void setPermittedPoints(PointFilterState permittedPoints) {
		if (permittedPoints == null) {
			return;
		}
		try {
			Marshaller marshaller = jaxbCtx.createMarshaller();
			StringWriter writer = new StringWriter();
			marshaller.marshal(permittedPoints, writer);
			setPermittedPointsData(writer.toString());
			this.permittedPoints = permittedPoints;
		} catch (JAXBException e) {
			e.printStackTrace();
		}
	}

	@Column(length = Integer.MAX_VALUE)
	@Lob
	public String getPermittedPointsData() {
		return permittedPointsData;
	}

	public void setPermittedPointsData(String permittedPointsData) {
		this.permittedPointsData = permittedPointsData;
	}

	public Long getLanguageId() {
		return languageId;
	}

	public void setLanguageId(Long languageId) {
		this.languageId = languageId;
	}
}

package com.azry.cdms.model.user;

import javax.persistence.Column;
import javax.persistence.Entity;
import javax.persistence.GeneratedValue;
import javax.persistence.GenerationType;
import javax.persistence.Id;
import javax.persistence.ManyToMany;
import javax.persistence.SequenceGenerator;
import javax.xml.bind.annotation.XmlElement;
import javax.xml.bind.annotation.XmlElementWrapper;
import javax.xml.bind.annotation.XmlRootElement;
import java.io.Serializable;
import java.util.List;

@XmlRootElement
@Entity
public class UserGroup implements Serializable {

	private Integer id;

	private String name;

	private List<UserPermission> permissions;

	@Id
	@GeneratedValue(strategy=GenerationType.SEQUENCE, generator = "USER_GROUP_KEY_SEQUENCE")
	@SequenceGenerator(name = "USER_GROUP_KEY_SEQUENCE", sequenceName = "USER_GROUP_KEY_SEQUENCE")
	public Integer getId() {
		return id;
	}

	public void setId(Integer id) {
		this.id = id;
	}

	@Column(length = 200)
	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	@ManyToMany
	@XmlElement(name="permission")
	@XmlElementWrapper(name="permissions")
	public List<UserPermission> getPermissions() {
		return permissions;
	}

	public void setPermissions(List<UserPermission> permissions) {
		this.permissions = permissions;
	}
}

package com.azry.cdms.model.user;

import javax.persistence.Column;
import javax.persistence.Entity;
import javax.persistence.Id;
import javax.xml.bind.annotation.XmlRootElement;
import java.io.Serializable;

@XmlRootElement
@Entity
public class UserPermission implements Serializable {

	private String code;

	private String name;

	private String groupName;

	@Id
	public String getCode() {
		return code;
	}

	public void setCode(String code) {
		this.code = code;
	}

	@Column(length = 500)
	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	@Column(length = 500)
	public String getGroupName() {
		return groupName;
	}

	public void setGroupName(String groupName) {
		this.groupName = groupName;
	}
}
